import PageHead from "../../../components/PageHead/PageHead";

export default function Review() {
    return (
        <>
            <div className="Review">
                <Sidebar pages={BrocampTabs} current={'Review'} />
                <div className="content">
                    <PageHead title={'Weekly Review'} />
                    <div className="main">
